function difference(set1, set2) {
    var myArray = set1.slice();
    for (var i = 0; i < set1.length; i++) {
        for (var j = 0; j < set2.length; j++) {
            if (set1[i] === set2[j]) {
                myArray.splice(i, i + 1);
            }
        }
    }
    return myArray;
}

module.exports = difference